function fixedTableRow() {
	const header = document.querySelector('.header');
	const row = document.querySelector('.table-md .row-first');
	if (row) {
		document.addEventListener('scroll', () => {

			row.style.top = (header.offsetHeight + 50) + 'px';
		});
	}

}

fixedTableRow();

function clickOutSideToCloseVimeo(event) {
	if(document.getElementsByClassName('popup-overlay active')[0]) {
		const rect = document.getElementsByClassName('wrap-video')[0].getBoundingClientRect();
		const x = rect.x;
		const y = rect.y;
		const width = rect.width;
		const height = rect.height;
		const xx = x + width
		const yy = y + height
		if (x <= event.clientX && event.clientX <= xx && y <= event.clientY && event.clientY <= yy) {

		} else {
			document.getElementsByClassName('popup-close')[0].click()
			$('body').removeClass('stop-scrolling')
		}
	}
}

document.addEventListener("click", clickOutSideToCloseVimeo);

$( document ).ready(function() {
	const urlParams = new URLSearchParams(window.location.search);
	const animation = urlParams.get('animation')
	if(animation === 'false') {
		$('.an').each(function () {
			$(this).addClass('no-animation');
		});
	}
});
